import React from 'react';


    const Tickets = ({ tickets }) => {
      return (
        <div>
          <table class="table table-striped table-bordered table-sm">
              <tbody>
                {tickets.map((ticket) => (
                    <tr>
                        <td>{ticket.title}</td>
                        <td>{ticket.email}</td>
                    </tr>
                ))}
            </tbody>
          </table>
        </div>
      )
    };

    export default Tickets
